Cold Case JFK

Science Documentary hosted by Jay Sander, published by PBS broadcasted as part of PBS Nova series in 2013 - English narration


Information
------------------------------

Fifty years later, what can science tell us about the Kennedy assassination-and the investigations that followed? The 1963 murder, in broad daylight in front of hundreds of witnesses, might seem to be a homicide investigator's best-case scenario. Yet somehow the JFK assassination became a forensic nightmare, plagued by a controversial autopsy and, incredibly, a prime suspect murdered on live television while in police custody, before he could be tried. As a result, today millions of Americans suspect a conspiracy. Now, NOVA launches a fresh investigation into the physical evidence, using state-of-the-art forensics, including laser scanning, new ballistics tests, and a 3D digital reconstruction of the president's skull, all to try to solve the murder of the century. &quot;Cold Case JFK&quot;is part of series of specials airing on PBS in November to commemorate the 50th anniversary of President John F. Kennedy's death.

